import React from 'react';
import './OwnerInfoBlock.less';

type OwnerType = {
  owner: {
    name: string,
    phoneNumber: string,
  },
};

const OwnerInfoBlock: React.FC<OwnerType> = ({ owner }: OwnerType) => {
  const { name, phoneNumber } = owner;
  return (
    <div className="owner-block">
      {name}
      {phoneNumber}
    </div>
  );
};

export default OwnerInfoBlock;
